import React, { useEffect, useRef } from "react";
import ITyped from "react-ityped";
import Yellow from "../../asset/yellow_ellipse.png";

const About = () => {
    const strings = ["Startups", "SMEs"];

    return (
        <div className="relative text-center  mt-28">
            <div
                className="absolute -right-24 lg:inline-block "
                style={{ bottom: "-10px" }}
            >
                <img src={Yellow} alt="ellipse" className="w-20 " />
            </div>
            <div className="w-40/50 ml-auto mr-auto text-left">
                <p class="text-gray-500 md:text-lg mb-5 hide-slideUp mt-52">
                    Hello, I am{" "}
                    <span class="text-gray-900 inline-block">N</span>
                    <span class="hidden-name inline-block align-middle">
                        waose
                    </span>
                    <span class="text-gray-900">V</span>
                    <span class="hidden-name inline-block align-middle">
                        ictor
                    </span>
                </p>
                <h1 className="text-7xl font-sans text-left font-bold text-gray-800">
                    I build visually appealing websites and softwares for
                </h1>
            </div>

            <ITyped
                className="container ityped-cursor"
                showCursor={false}
                strings={strings}
                typeSpeed={500}
                backSpeed={500}
                startDelay={500}
                backDelay={900}
            />
        </div>
    );
};

export default About;
